BEGIN TRANSACTION;
CREATE TABLE 'live_data' ('music_id' INTEGER NOT NULL, 'sort' INTEGER NOT NULL, 'music_type' INTEGER NOT NULL, 'title_color_top' TEXT NOT NULL, 'title_color_bottom' TEXT NOT NULL, 'condition_type' INTEGER NOT NULL, 'song_chara_type' INTEGER NOT NULL, 'live_member_number' INTEGER NOT NULL, 'default_main_dress' INTEGER NOT NULL, 'default_main_dress_color' INTEGER NOT NULL, 'default_mob_dress' INTEGER NOT NULL, 'default_mob_dress_color' INTEGER NOT NULL, 'backdancer_order' INTEGER NOT NULL, 'backdancer_dress' INTEGER NOT NULL, 'backdancer_dress_color' INTEGER NOT NULL, 'start_date' INTEGER NOT NULL, 'end_date' INTEGER NOT NULL, PRIMARY KEY('music_id'), UNIQUE('sort'));
COMMIT;